def numIslands(grid):
            if grid == []:
                return 0
            m = len(grid)
            n = len(grid[0])
            checkedMatrix = [[0 for j in range(n)] for i in range(m)]       
            numIsl = 0
            for i in range(m):
                for j in range(n):
                    if checkedMatrix[i][j] == 0:
                        if grid[i][j] == '1':
                            searchLand(grid,checkedMatrix,m,n,i,j)
                            numIsl += 1
            return numIsl
def searchLand(grid,checkedMatrix, m,n, i,j):
        checkedMatrix[i][j] = 1
        #search all neighbor 1
        #up
        if (i > 0): 
            if (checkedMatrix[i-1][j] == 0) & (grid[i-1][j] == '1'):
                searchLand(grid,checkedMatrix,m,n,i-1,j)
        #left
        if (j > 0):
            if (checkedMatrix[i][j-1] == 0) & (grid[i][j-1] == '1'):
                searchLand(grid,checkedMatrix,m,n,i,j-1)
        #down
        if (i < m-1):
            if (checkedMatrix[i+1][j] == 0) & (grid[i+1][j] == '1'):
                searchLand(grid,checkedMatrix,m,n,i+1,j)
        #right
        if (j < n-1):
            if (checkedMatrix[i][j+1] == 0) & (grid[i][j+1] == '1'):
                searchLand(grid,checkedMatrix,m,n,i,j+1)
        checkedMatrix[i][j] = 2
        return None

